import React from 'react'
import Countrie from './Countrie'

const Countries = ({ countries }) => {

    let toShow = undefined

    const countryList = () => countries.map(countrie =>
        <Countrie key={countrie.name} countrie={countrie} />
    )

    if (countries.length < 1)
        toShow = <p>There is no matches</p>
    else if (countries.length > 10)
        toShow = <p>Too many matches, specify another filter</p>
    else
        toShow = countries.map(countrie =>
            <Countrie key={countrie.name} countrie={countrie} />
        )

    return toShow
}

export default Countries
